import { useLocation } from "react-router-dom";
const Game = () => {
  const {
    state: { url },
  } = useLocation();
  return (
    <div className="gameBox">
      <iframe src={url} height="100%" scrolling="none" frameborder="0"></iframe>
    </div>
  );
};

export default Game;
